import styles from "./NavBar.module.scss";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faLinkedinIn,
  faGithub
} from "@fortawesome/free-brands-svg-icons";


export const NavBar = () => {
  return (
    <div className={styles.navbar}>
      <Link to="/HomePage" className={styles.navbar__brand}>
      <button className={styles.navbar__brand_name}>
        C<span className={styles.navbar__brand_tiny}>ara</span>T
        <span className={styles.navbar__brand_tiny}>ran</span>
      </button>
      </Link>
      <div className={styles.navbar__contact}>

      <FontAwesomeIcon
          icon={faLinkedinIn}
          // size="4x"
          className={styles.navbar__contacticon_shadow}
        />
        <FontAwesomeIcon
          icon={faGithub}
          // size="4x"
          className={styles.skills__icon_shadow}
        />

          {/* <a className={styles.contactme_icon} href="https://www.linkedin.com/in/carajanetran/">
            <i class="fab fa-linkedin fa-3x"></i>
          </a> */}
          {/* <a className={styles.contactme_icon} href="mailto:cjbtran@gmail.com">
            <i class="fas fa-envelope-square fa-3x"></i>
          </a> */}
      </div>
      {/* <Link to="/ProjectsPage" className={styles.navbar__links}>
        PROJECTS
      </Link> */}
      {/* <Link to="/AboutMePage" className={styles.navbar__links}>
        ABOUT
      </Link> */}
            {/* <Link to="/AboutMePage" className={styles.navbar__links}>
        CONTACT
      </Link> */}
      {/* <Link to ="/AboutMePage" className={styles.navbar_links}>SKILLS</Link> */}
      <div className={styles.navbar__links}>
      <div to="/ProjectsSection" className={styles.navbar__links_item}>
        PROJECTS
      </div>
      <div to="/AboutSection" className={styles.navbar__links_item}>
        ABOUT
      </div>
      <div to="/SkillsSection" className={styles.navbar__links_item}>
        SKILLS
      </div>
      <div to="/ContactSection" className={styles.navbar__links_item}>
        CONTACT
      </div>

      <a
        className={styles.navbar__links_item}
        href="https://drive.google.com/file/d/1uiWEA-P7Ae5QbhsN1tWPb3-oq4yBOayz/view?usp=sharing"
      >
        CV
      </a>
      </div>
    </div>
  );
};
